import React from 'react';
import { Section, Columns, Card, Heading, Media, Image} from 'react-bulma-components';
const TeamProfile = (props) => {
    return (
      <Card>
        <Media>
          <Media.Item>
           <Image size={256} alt="profile" src={props.image} />
          </Media.Item> 
          <br></br>
          <Media.Item>
            {props.name}
            <b>{props.title}</b> <br></br>
            Background in sustainability, previously co-founded two companies and worked with product and business development
          </Media.Item>
        </Media>
      </Card>
    )
}
export default TeamProfile
